import React, {useState} from 'react'
import Show from '../components/Show_tmp'
import useFetch from '../handling/useFetch'

const Home = () => {
  const { error, isPending, datalog } = useFetch('http://localhost:8080/api/datalog')
  const [isEmpty, setEmpty] = useState(false)
  
  if (datalog.length === 0) {
    setEmpty(true)
  }
  console.log(datalog)

  return (
    <div className='home'>
      {error && <div>{error}</div>}
      {isPending && <div className='show'>Loading..</div>}
      {isEmpty && <div>No data</div>}
      {datalog && <Show datalog={datalog} />}
    </div>
  )
}

export default Home
